import React from "react";
import "./NavBar.css";
import { NavLink as RRNavLink } from "react-router-dom";
import { Navbar, NavbarBrand, Nav, NavItem, NavLink } from "reactstrap";

function NavBar() {
  return (
    <Navbar expand="md" light>
      {/* Use Reactstrapâ€™s NavbarBrand but render it as RR NavLink */}
      <NavbarBrand tag={RRNavLink} to="/" end>
        Snack or Booze
      </NavbarBrand>

      <Nav className="ms-auto" navbar>
        {["snacks","drinks"].map((path) => (
          <NavItem key={path}>
            {/* Use the Reactstrap NavLink, but render it as RR NavLink */}
            <NavLink
              tag={RRNavLink}
              to={`/${path}`}
              className={({ isActive }) =>
                "nav-link" + (isActive ? " active" : "")
              }
            >
              {path[0].toUpperCase() + path.slice(1)}
            </NavLink>
          </NavItem>
        ))}
      </Nav>
    </Navbar>
  );
}

export default NavBar;
